Lietuvos plaukimo rinktinės auksinė apdovanojimų lentyna Kopenhagoje vykstančiame Europos plaukimo trumpajame baseine (25 m) čempionate pasipildė dar vienu medaliu. Šeštadienį vakare R. Meilutytė 100 m krūtine finale distanciją įveikė per 1 min 03,79 sek. ir užtikrintai tapo nugalėtoja. „Labai jaudinausi prieš startą. Nežinojau, ko tikėtis. Norėjau geriau jaustis. Nesitikėjau, kad toks rezultatas pavyks, – iš karto po plaukimo kalbėjo R. Meilutytė. – Reikėjo man pasinaudoti savo stipriąja dalimi – pirmuosius 50 metrų plaukti greičiau ir laikyti atstumą, nes visos varžovės stiprios antroje pusėje. Tai ir mėginau daryti, per daug nesižvalgiau“. (function(d, s, i, r) {
