		})(document, 'script', 'facebook-jssdk', 'fb-root'); Sidabro medalį laimėjo suomė Jenna Laukkanen (1:04,25), bronzą – ispanė Jessica Vall Montero (1:04.80). „Slaptose svajonėse buvo du aukso medaliai, – prisipažino dukart Europos čempione Kopenhagoje tapusi lietuvė. – Savo rezultatais atsidėkoju gerbėjams. Ačiū treneriui, komandai, šeimai, draugams, kurie mane palaiko. Tikrai šie metai buvo nelengvi ir pabaigti taip, labai smagu. Juk daug darbo įdėta“. Atrankos plaukime penktadienį 100 m krūtine R. Meilutytė įveikė per 1 min. 06,09 sek. ir užėmė 9-ą vietą. Pusfinalyje ji plaukė daug greičiau – per 1 min. 04,95 sek. ir į finalą prasibrovė su antru geriausiu rezultatu. Tai jau antrasis Londono olimpinės čempionės trofėjus Danijos sostinėje. Pirmąją Europos čempionato dieną ji laimėjo auksą 50 m krūtine rungtyje. R. Meilutytė su treneriu dar neapsisprendė, ar plauks sekmadienį 200 m krūtine atrankoje. 100 m laisvuoju stiliumi į finalą prasibrovė  Simonas Bilis.  Šeštadienį vykusiame pusfinalyje panevėžietis distanciją įveikė 47,11 sek. ir 7-uoju rezultatu pateko į finalą. Nuo geriausią rezultatą pademonstravusio italo Lucos Dotto (46,82 sek.) lietuvis atsiliko 0,29 sek. „Dabar jau kaip bus, taip bus. Reikia tik atsipalaiduoti, pasiruošti“, – po pusfinalio kalbėjo S. Bilis. Jis teigė, kad ryte viską skaudėjo: „Galvoju, kad šortus naujus paėmiau, tai kojas skaudėjo. Nauji labai spaudžia. Dabar neatrodo pavargusios kojos lyginant su rytu. Viena pakopa perlipta. Laiku nepatenkintas, bet kad patekau, tai gerai“. 100 m laisvuoju stiliumi finalas vyks sekmadienį 18.23 val. Po keturių dienų Kopenhagoje vykstančiose Europos plaukimo trumpajame baseine (25 m) pirmenybėse Lietuvos kraityje yra trys aukso ir vienas bronzos medaliai. Aukso apdovanojimus iškovojo R. Meilutytė (50 m ir 100 m krūtine) ir Danas Rapšys (200 m laisvuoju stiliumi). Pastarasis dar pridėjo bronzos medalį 200 m nugara rungtyje. Lietuvos plaukikų planuojami startai ir rezultatai Europos čempionate Kopenhagoje: Rūta Meilutytė: 50 m ( 29,36 sek. – 1 vieta ), 100 m ( 1.03,79 – 1 vieta ), 200 m krūtine; Giedrius Titenis: 50 m (26,90 – 18 vieta),100 m (58,08 – 11 vieta), 200 m (2:06.92  NR  – 11 vieta) krūtine; Andrius Šidlauskas: 50 m (27,31 – 35 vieta), 100 m (57,96  PB  – 10 vieta), 200 m (2.08,96 – 21 vieta) krūtine; Danas Rapšys : 200 m nugara ( 1.49,06 NR – 3 vieta ), 100 m (47,73  PB  – 20 vieta), 200 m laisvuoju stiliumi ( 1.40,85 NR – 1 vieta ), 200 m peteliške; Gytis Stankevičius : 50 m,100 m (53,10  PB  – 34 vieta), 200 m (1.55,97  PB  – 21 vieta) m nugara; Simonas Bilis : 50 m (21,32 – 12 vieta), 100 m laisvuoju stiliumi; Povilas Strazdas : 100 m (49,28 – 60 vieta), 200 m (1.47,51 – 35 vieta) laisvuoju stiliumi, 100 m (55,14 – 31 vieta), 200 m kompleksiniu plaukimu (1.59,51 – 29 vieta); Deividas Margevičius : 50 m (22,97 – 14 vieta),100 (51,83  PB  – 25 vieta), 200 m peteliške; Tadas Duškinas: 100 m (52,03 – 27-28 vieta), 50 m peteliške (23,29 – 23 vieta), 50 m laisvuoju stiliumi (21,69  PB  – 23 vieta) Ugnė Mažutaitytė : 100 m (1.01,52 – 39 vieta) ir 200 m (2.08,33 – 12 vieta) nugara; Vyrų estafetė: 4x50 kompleksiniu plaukimu; * NR - Lietuvos rekordas, PB - asmeninis rekordas Į Daniją Lietuva delegavo 10 geriausių plaukikų.  Ši delegacija – viena gausiausių nuo 1998-ųjų metų. Daugiau – 12 mūsų šalies plaukikų – dalyvavo 2004 metais Vienoje (Austrija), 11 – 2005 metais Trieste (Italija), 2006 metais Helsinkyje (Suomija) ir 2013 metais Herninge (Danija). Būtent prieš ketverius metus Danijoje R. Meilutytė iškovojo Lietuvai pirmuosius aukso medalius šių varžybų istorijoje. Lietuvos plaukimo žvaigždė tuomet triumfavo 100 m kompleksinio plaukimo ir 100 m plaukimo krūtine finaluose. Iš viso prie 16-os lietuvių iškovotų medalių Europos čempionatų trumpame baseine istorijoje daugiausiai prisidėjo Vytautas Janušaitis. Jis laimėjo 6 sidabrinius ir 2 bronzinius apdovanojimus. Iš dabartinės Lietuvos plaukimo rinktinės ant apdovanojimų pakylos yra lipę R. Meilutytė (2 ausko ir sidabro medalis) ir Giedrius Titenis (bronzos medalis). 19-asis Europos čempionatas trumpajame baseine (25 m) Kopenhagoje, Danijoje, vyksta gruodžio 13–17 dienomis. Šios varžybos yra pirmasis sporto renginys naujoje daugiafunkcinėje „Royal“ arenoje. Pastaroji talpina apie 16 tūkst. žiūrovų, tačiau dėl pakeltų tribūnų plaukimo kovas stebės apie 6500 sirgalių. Senojo žemyno pirmenybėse dalyvauja daugiau nei 1000 atletų, per penkias dienas „Royal“ arenoje bus karūnuoti 40 naujų Europos čempionų. Oficialus Europos plaukimo čempionato simbolis yra Dana. Ji įkūnija visą Daniją, Danijos plaukikus, Kopenhagą, šalies istoriją ir plaukimą kaip sporto šaką. Kopenhagoje sporto renginių netrūks ir per artimiausius dvejus metus. 2018 metais čia planuojama rengti IIHF pasaulio ledo ritulio čempionatą, o 2020 metais – Danijos sostinėje bus žaidžiamos Europos futbolo pirmenybių rungtynės.
